import React, {useState} from "react";
import axios from "axios";
import {makeStyles} from "@material-ui/core/styles";
import AUTH_ROUTES , {RenderRoutes,RouteWithSubRoutes} from "../Route/AUTH_ROUTES";
import {BrowserRoute,Switch,Route} from "react-router-dom";
import Home from "./Home/Home";
import Club from "./Club/Club";


const useStyles = makeStyles((theme) => ({
NavBar:{
    backgroundColor: "purple",
    minHeight:"3.4em",
    flexDirection:"row",
    alignItems:"center"
},
ClubBar:{
    position:"fixed",
    height:"100%",
    width:"70px",
    backgroundColor:"orange",
    zIndex:"1",
    top:"3.4em",
    overflowX:"hidden",
    paddingTop:"10px"
},



}));

export default function AppBar( param){

    return(

        <div>
            <div className={useStyles().NavBar}>
                <form className="navbar-search top">
                    <input type="text" className="search-query" placeholder="Search"/>
                </form>
            </div>
            <div  className={useStyles().ClubBar}>YO</div>

        </div>

    )
}
